import React from 'react';
import PropTypes from 'prop-types';
import { Col, List, Row } from 'antd';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	console.log(current);

	return (
		<Row>
			<List
				size='small'
				bordered
				dataSource={current}
				renderItem={(item) => (
					<List.Item>
						<Col span={24}>
							<p>{item.title}</p>
						</Col>
					</List.Item>
				)}
			/>
		</Row>
	);
}

export default ListViewTest;
